import React from "react";
import { IoIosTimer, IoMdPersonAdd } from "react-icons/io";
// import { IoPersonAddOutline } from "react-icons/io5";

const Head = () => {
  const styleIcon = { fontSize: "20px", color: "#f38e82" };
  const alignCenter = {
    display: "flex",
    alignItems: "center",
    paddingRight: "40px",
  };

  return (
    <>
      <h2 class="heading--2">Recipe ingredients</h2>
      <div style={{ display: "flex" }}>
        <div
          style={{
            display: "flex",
            alignItems: "center",
            paddingRight: "40px",
          }}
        >
          <IoIosTimer style={styleIcon} /> 75 MINUTE
        </div>
        <div>
          <IoMdPersonAdd style={styleIcon} /> 4 SERVINGS
        </div>
      </div>
    </>
  );
};

export default Head;
